import React, {Component} from 'react'

export class SignUp extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return(
            <div>
                <div style={{marginBottom: '20px'}}>
                    <div className="container" style={{margin: '50px auto',marginTop: '50px'}}>
                        <div className="row" style={{margin: '0px'}}
                        ></div>
                    </div>
                </div>
            </div>
        )
    }
}
